# --- START: Filtering logic ---

# === 2. DEFINE YOUR FILTERS HERE ===
MINIMUM_YEAR = 1940
FORCING_TYPE = "cmip6" # Ensures we get 'cmip6' and not 'smbb' files

# This creates the whitelist of 40 members based on your list
# (r1-r10 for i-groups 1231, 1251, 1281, 1301)
initialization_groups = ["1231", "1251", "1281", "1301"]
realizations = range(1, 11)  # This gives numbers 1 through 10

MEMBER_WHITELIST = []
for i_group in initialization_groups:
    for r_num in realizations:
        # Formats the name, e.g., LE2-1231.001 or LE2-1231.010
        member_id = f"LE2-{i_group}.{r_num:03d}" 
        MEMBER_WHITELIST.append(member_id)

print(f"Filtering for {len(MEMBER_WHITELIST)} specific members (r1-r10 from i-groups 1231, 1251, 1281, 1301)...")
print(f"Also filtering for forcing type = '{FORCING_TYPE}'...")
print(f"Also filtering for start year >= {MINIMUM_YEAR}...")

filtered_filelist = []

for file_url in filelist:
    
    # Criterion 1: Check if the member is in our whitelist
    is_in_whitelist = False
    for member_id in MEMBER_WHITELIST:
        if member_id in file_url:
            is_in_whitelist = True
            break # Found a match
    
    if not is_in_whitelist:
        continue # Skip this file, it's not in our list of 40 members

    # Criterion 2: Check for forcing type (e.g., "cmip6")
    if FORCING_TYPE not in file_url:
        continue # Skip this file (it's 'smbb' or other)

    # Criterion 3: Check for year (only for files that passed C1 and C2)
    try:
        filename = os.path.basename(file_url)
        date_range_str = filename.split('.')[-2]
        start_date_str = date_range_str.split('-')[0]
        year = int(start_date_str[:4])
        
        if year < MINIMUM_YEAR:
            continue # Skip this file (it's in our member list, but too old)
    except Exception as e:
        print(f"\nWarning: Could not parse year from {filename}. Skipping. Error: {e}")
        continue
    
    # If all 3 conditions passed, add the file to our new list
    filtered_filelist.append(file_url)

print(f"Original list size: {len(filelist)}")
print(f"Filtered list size: {len(filtered_filelist)} (These will be downloaded)")
# --- END: New filtering logic ---


# --- 3. Create the download folder if it doesn't exist ---
print(f"Ensuring download directory exists: {DOWNLOAD_FOLDER}")
os.makedirs(DOWNLOAD_FOLDER, exist_ok=True)


# --- 4. Download loop (now uses 'filtered_filelist') ---
if not filtered_filelist:
    print("\nNo files matched your criteria. Nothing to download.")
else:
    print(f"\nStarting download of {len(filtered_filelist)} files...")

for file in filtered_filelist:
    ofile = os.path.basename(file)
    
    # Create the full path to save the file
    full_output_path = os.path.join(DOWNLOAD_FOLDER, ofile)
    
    sys.stdout.write(f"downloading to {full_output_path} ... ")
    sys.stdout.flush()
    try:
        infile = opener.open(file)
        # Use 'with' and the new full_output_path to save the file
        with open(full_output_path, "wb") as outfile:
            outfile.write(infile.read())
        sys.stdout.write("done\n")
    except Exception as e:
        sys.stdout.write(f"FAILED. Error: {e}\n")

print("Download script finished.")